import Input from "../Input/Input";
function Form(props) {
    return (
        <form className="Form">
            <div className="Group">

                <Input inp = {props.inp1} />
                <Input inp = {props.inp} />
                <Input inp = {props.inp} />

            </div>

            <button>Submit</button>
        </form>
    );
}

export default Form
